#this is a class that translates any file into a binary file and turns it back into the original file.
#Makebin is utilized to translate files into lists that can then be added to this module. 
#the above function makePicture is used to translate that list back into a file.		
class myBin():
	def makeBin(self, filename, newname):
		one=open(filename, 'rb').read()
		myfile= open(newname, 'w')
		one= list(one)
		two = [ord(num) for num in one]
		myfile.write(str(two))
		myfile.close()

	def makeNewPicture(self, filename, newpng):
		one=open(filename, 'rb').read()	
		one= one[1:]
		one = one[:-1]
		parts = one.split(',')
		mypic = [chr(int(num)) for num in parts]
		mypic = ''.join(mypic)
		myfile= open(newpng, 'wb')
		myfile.write(str(mypic))
		myfile.close()
			
